window.bookSummaryJSON = "<p><b>The number-one </b><b><i>New York Times </i></b><b>best-selling series returns with Mitch Rapp racing against the clock to take down Russia's ailing leader before he invades the Baltics.</b></p> <p>When Max Krupin - Russia's leader - discovers that his kidney cancer has spread to his brain, he's determined to hide his diagnosis. He begins by getting rid of anyone threatening to him - as well as creating chaos in the region to keep the world's attention diverted. Soon, Krupin's illness becomes serious enough that he needs a more dramatic diversion, prompting him to invade the Baltics.</p> <p>Desperate to understand what's causing Krupin's uncharacteristically erratic behavior and Russia's aggressive moves in the region, America begins working with Russia's disgraced prime minister to stage a coup. Its success relies on Mitch Rapp's ability to successfully find and quietly get rid of the ailing president before Europe is drawn into a war with a man who has nothing to lose.</p> <p>For fans of \"black-ops thrillers, Mitch Rapp continues to be among the best of the best\" (<i>Booklist</i>, starred review).</p>"; 
